import logo from './logo.svg';
import './App.css';
import SearchCritera from './Component/SearchCriteria';
import React, {useState, useEffect} from 'react';

function App() {
  const[criteria, setCriteria] = useState([]);

  useEffect(() => {
    fetchCriteriaHandler();
  }, []);

  function fetchCriteriaHandler(){
    fetch('https://localhost:7195/api/SearchCriteria/Get')
      .then(response => response.json())
      .then((data) => { 
        console.log(data);
        setCriteria(data.results)});
    }

  return (
   <React.Fragment>
     <SearchCritera criteria={criteria}></SearchCritera>
   </React.Fragment>

  );
}

export default App;
